import { useNavigate } from 'react-router-dom';

export default function LoginButton() {
  const history = useNavigate();

  const handleLogin = () => {
    history.push('/home');
  };

  return <button type="submit" defaultValue="Registrar" className="button--general login-btn" onClick={handleLogin()}>Registrarse</button>;
}
